import React from 'react';
import './css/style.css';
import './css/app.css';
import './css/card.css';

import Card from './Componentes/card';
function App() {
  return (
    <div id="app">
      <section className='card'>
        <ul>
          <Card />
          <Card />
          <Card />
          <Card />
        </ul>
      </section>
    </div>
  );
}

export default App;
